 */
library Math {
    // using SafeMath for uint256;

    // ============ Library Functions ============

    /*
     * Return target * (numerator / denominator).
     */
    function getPartial(
        uint256 target,
        uint256 numerator,
        uint256 denominator
    ) internal pure returns (uint256) {
        return (target * (numerator)) / (denominator);
    }

    /*
     * Return target * (numerator / denominator), but rounded up.
     */
    // function getPartialRoundUp(
